import React from 'react';
import './App.css';
//import 'bootstrap/dist/css/bootstrap.min.css';
import {
  MainNavbar,
  MainJumbotron,
  About,
  Recruiting,
  Team,
} from './components/componentIndex.jsx'

function App() {

  const fetch_recruiters = async () => {
    const response = await fetch('http://192.168.56.101:1337/recruiters');
    const data = await response.json();
    return data;
  }

  const fetch_blogposts = async () => {
    const response = await fetch('http://192.168.56.101:1337/blogpost');
    const data = await response.json();
    return data;
  }

  return (
    <div className="App">
      <MainNavbar />
      <MainJumbotron />
      <About />
      <Team recruiters-data={fetch_recruiters()}/>
      <Recruiting />
    </div>
  );
}

export default App;
